import logo from './logo.svg';
import './App.css';
import { Avatar, Card, DatePicker, Segmented } from 'antd';
import { EditOutlined, EllipsisOutlined, ShoppingCartOutlined  } from '@ant-design/icons';
import Meta from 'antd/es/card/Meta';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        Menu
        <Segmented
          className='menu'
          options={[
            'Breakfast',
            'Lunch',
            'Snacks',
            'Desserts',
            'Drinks',
          ]} />

        <Card
          style={{
            width:250,
          }}
          cover={
            <img
              alt="example"
              src="https://images.immediate.co.uk/production/volatile/sites/30/2014/05/Epic-summer-salad-hub-2646e6e.jpg"
            />
          }
          actions={[
            <ShoppingCartOutlined  key="shop"  v/>,
            // <EditOutlined key="edit" />,
            // <EllipsisOutlined key="ellipsis" />,
          ]}
        >
          <Meta 
            title="Summer salad"
            description="For a refreshing sumer day"
          />
        </Card></header>
    </div>
  );
}

export default App;
